function Counter(){
  const [like,setlike] = useState(0);
  const [dislike,setdislike] = useState(0);
  return(
    <div className="likes">
      <button className="likebutton" onClick={()=>setlike(like+1)}>👍 {like}</button>
      <button className="likebutton" onClick={()=>setdislike(dislike+1)}>👎 {dislike}</button>
      <button className="likebutton">🗑️</button>
    </div>
  )
}

function Msg({name,pic,index}){
  return (
   <div className="poster">
      <img className="pic" height="100"
      src={pic} alt="Movie"/>
      <Counter />
      <h1 className="name">{name}</h1>
    </div>
  );  
}

